function CountButton({initialCount}){
    let [count, setCount] = useState(initialCount);

    function resetCount()
    {
        this.setState({count:0});
    }
    return(
            <>
                Count:{count}
                <button onClick={resetCount}>Reset</button>
                <button onClick={() =>setCount(++count)}>+</button>
                <button onClick={() =>setCount(--count)}>-</button>
            </>
    );
}

